import React from 'react';


const ChangeColorButtons = (props) => {
    return(
        <div className='buttons-panel'>
            <button onClick={ () => {
                props.method('blue');
                console.log('this')
            }}>Blue</button>
            <button onClick={ () => {
                props.method('yellow');
            }}>yellow</button>
            <button onClick={ () => {
                props.method('green');
            }}>green</button>
        </div>
    );
}

export default ChangeColorButtons;
